import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { ChapterContextProvider } from './context/ChapterContext';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <ChapterContextProvider>
    <App />
    </ChapterContextProvider>
  </React.StrictMode>
);
